import { GET_UPDATE_USER_CRM, GET_USER_CRM } from "./valiable.reducer";

const initialState = {
    dataUserUpdate: {},
    dataUser: {}
}

export const userReducer = (state = initialState, action) => {
    switch (action.type) {
        case GET_UPDATE_USER_CRM: {
            state.dataUserUpdate = action.datas;
            return { ...state }
        }
        case GET_USER_CRM: {
            // state.dataUser = action.datas;
            console.log(action.datas);
            return { ...state }
        }

        default:
            return state
    }
}
